import React from 'react'

interface todoListProps {
    items: { id: string, title: string }[]
}

export default function Todo(props): React.FC<todoListProps> {
    return (
        <ul>
            {
                props.items.map(todo => <li key={todo.id}>{todo.title}</li>)
            }
        </ul>
    )
}
